    {
        productName: 'Star Wars\' Phone Cases',
        productPrice: 'Rp. 6749865',
        productDescription: 'Product Description',
        productImage: 'Image'
    },
]

const Index = props => (
    <Layout>
        <h1>Next Market</h1>
        <Header />
        <Search />
        <Products
            image="img1.png"
            title="Star Wars Home Arcade Game"
            price="Rp. 6749865"
            description="This gergeous, three-quarter-sized arcade cabinet comes loaded with some
            classic Star Wars gaming titles, including A New Hope, The Empire Strikes
            Back, and Return of the Jedi"
        />

    </Layout>

);

export default Index;
